import React from "react";

/**
 * Navbar for Synaptra Core
 * -------------------------
 * - Fixed top branding bar
 * - Version display on right
 */
export default function Navbar() {
  return (
    <nav
      className="navbar"
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "16px 32px",
        background: "rgba(11,15,26,0.7)",
        borderBottom: "1px solid rgba(255,255,255,0.08)",
        backdropFilter: "blur(12px)",
        position: "sticky",
        top: 0,
        zIndex: 10,
      }}
    >
      <div
        style={{
          display: "flex",
          alignItems: "center",
          gap: "10px",
        }}
      >
        <div
          style={{
            width: "22px",
            height: "22px",
            borderRadius: "50%",
            background: "linear-gradient(135deg,#5ee7ff,#7c3aed)",
          }}
        />
        <h1
          style={{
            fontSize: "18px",
            fontWeight: "700",
            color: "#5ee7ff",
            letterSpacing: "0.2px",
          }}
        >
          Synaptra Core
        </h1>
      </div>
      <div
        style={{
          color: "rgba(255,255,255,0.6)",
          fontSize: "13px",
          letterSpacing: "0.3px",
        }}
      >
        v3.0
      </div>
    </nav>
  );
}
